import "./App.css";
import ExpenseList from "./Components/ExpenseList";
import FilterForm from "./Components/FilterForm";

function App() {
  const expenses = [
    {
      name: "chocolate",
      price: 2660,
      type: "food",
      date: new Date(),
      memo: "hoooha",
      repurchase: true,
    },
    {
      name: "candy",
      price: 3000,
      type: "food",
      date: new Date(),
      memo: "hoooha",
      repurchase: true,
    },
  ];
  return (
    <div className="App">
      <FilterForm />
      <ExpenseList />
    </div>
  );
}

export default App;
